void logic_net(bool_t const inp[1512], bool_t out[4096]);

static inline bool_t apply_gate(bool_t a, bool_t b, gate_t op) {
#ifndef __SYNTHESIS__
#pragma HLS inline off
#else
#pragma HLS inline
#endif
    switch(op) {
        case 0: return 0;              // zero
        case 1: return a && b;         // and
        case 2: return a && !b;        // not_implies
        case 3: return a;              // a
        case 4: return b && !a;        // not_implied_by
        case 5: return b;              // b
        case 6: return a != b;         // xor
        case 7: return a || b;         // or
        case 8: return !(a || b);      // not_or
        case 9: return (a == b);       // not_xor
        case 10: return !b;            // not_b
        case 11: return (!b) || a;     // implied_by
        case 12: return !a;            // not_a
        case 13: return (!a) || b;     // implies
        case 14: return !(a && b);     // not_and
        case 15: return 1;             // one
        default: return 0;  // fallback to something safe
    }
}


// Convolutional layer conv_0
void conv_conv_0(const bool_t inp[1512], bool_t layer_conv_0_out[17920]) {

    bool_t conv_tree_0[128][140][16];
    bool_t conv_tree_1[128][140][8];
    bool_t conv_tree_2[128][140][4];
    bool_t conv_tree_3[128][140][2];
    bool_t conv_tree_4[128][140][1];
#pragma HLS ARRAY_PARTITION variable=conv_tree_0 complete dim=1
#pragma HLS ARRAY_PARTITION variable=conv_tree_1 complete dim=1
#pragma HLS ARRAY_PARTITION variable=conv_tree_2 complete dim=1
#pragma HLS ARRAY_PARTITION variable=conv_tree_3 complete dim=1
#pragma HLS ARRAY_PARTITION variable=conv_tree_0 factor=4 dim=2
#pragma HLS ARRAY_PARTITION variable=conv_tree_1 factor=4 dim=2
#pragma HLS ARRAY_PARTITION variable=conv_tree_2 factor=4 dim=2
#pragma HLS ARRAY_PARTITION variable=conv_tree_3 factor=4 dim=2
#pragma HLS ARRAY_PARTITION variable=conv_tree_0 factor=8 dim=3
#pragma HLS ARRAY_PARTITION variable=conv_tree_1 factor=8 dim=3
#pragma HLS ARRAY_PARTITION variable=conv_tree_2 factor=8 dim=3
#pragma HLS ARRAY_PARTITION variable=conv_tree_3 factor=8 dim=3

    static const gate_t num_gates[5] = {16, 8, 4, 2, 1};

    for (size_t k = 0; k < 128; k++) {
        for (size_t p = 0; p < 140; p++) {
#pragma HLS UNROLL factor=10
            for (size_t g = 0; g < num_gates[0]; g++) {
#pragma HLS UNROLL
                bool_t left_val, right_val;
                // Base level: read from input feature map
                index_t lh = left_indices_conv_0_0[k][p][g][0];
                index_t lw = left_indices_conv_0_0[k][p][g][1];
                index_t lc = left_indices_conv_0_0[k][p][g][2];
                index_t rh = right_indices_conv_0_0[k][p][g][0];
                index_t rw = right_indices_conv_0_0[k][p][g][1];
                index_t rc = right_indices_conv_0_0[k][p][g][2];
                left_val  = inp[lc * 18 * 14 + lh * 14 + lw];
                right_val = inp[rc * 18 * 14 + rh * 14 + rw];
                bool_t result = apply_gate(left_val, right_val, conv_conv_0_treeops_d0[g][k]);
                conv_tree_0[k][p][g] = result;
            }
        }
    }
    for (size_t k = 0; k < 128; k++) {
        for (size_t p = 0; p < 140; p++) {
#pragma HLS UNROLL factor=10
            for (size_t g = 0; g < num_gates[1]; g++) {
#pragma HLS UNROLL
                bool_t left_val, right_val;
                // Higher levels: read from previous tree level
                index_t lidx = left_indices_conv_0_1[g];
                index_t ridx = right_indices_conv_0_1[g];
                left_val  = conv_tree_0[k][p][lidx];
                right_val = conv_tree_0[k][p][ridx];
                bool_t result = apply_gate(left_val, right_val, conv_conv_0_treeops_d1[g][k]);
                conv_tree_1[k][p][g] = result;
            }
        }
    }
    for (size_t k = 0; k < 128; k++) {
        for (size_t p = 0; p < 140; p++) {
#pragma HLS UNROLL factor=10
            for (size_t g = 0; g < num_gates[2]; g++) {
#pragma HLS UNROLL
                bool_t left_val, right_val;
                // Higher levels: read from previous tree level
                index_t lidx = left_indices_conv_0_2[g];
                index_t ridx = right_indices_conv_0_2[g];
                left_val  = conv_tree_1[k][p][lidx];
                right_val = conv_tree_1[k][p][ridx];
                bool_t result = apply_gate(left_val, right_val, conv_conv_0_treeops_d2[g][k]);
                conv_tree_2[k][p][g] = result;
            }
        }
    }
    for (size_t k = 0; k < 128; k++) {
        for (size_t p = 0; p < 140; p++) {
#pragma HLS UNROLL factor=10
            for (size_t g = 0; g < num_gates[3]; g++) {
#pragma HLS UNROLL
                bool_t left_val, right_val;
                // Higher levels: read from previous tree level
                index_t lidx = left_indices_conv_0_3[g];
                index_t ridx = right_indices_conv_0_3[g];
                left_val  = conv_tree_2[k][p][lidx];
                right_val = conv_tree_2[k][p][ridx];
                bool_t result = apply_gate(left_val, right_val, conv_conv_0_treeops_d3[g][k]);
                conv_tree_3[k][p][g] = result;
            }
        }
    }
    for (size_t k = 0; k < 128; k++) {
        for (size_t p = 0; p < 140; p++) {
#pragma HLS UNROLL factor=10
            for (size_t g = 0; g < num_gates[4]; g++) {
#pragma HLS UNROLL
                bool_t left_val, right_val;
                // Higher levels: read from previous tree level
                index_t lidx = left_indices_conv_0_4[g];
                index_t ridx = right_indices_conv_0_4[g];
                left_val  = conv_tree_3[k][p][lidx];
                right_val = conv_tree_3[k][p][ridx];
                bool_t result = apply_gate(left_val, right_val, conv_conv_0_treeops_d4[g][k]);
                size_t out_idx = k * 140 + p;
                layer_conv_0_out[out_idx] = result;
            }
        }
    }
}

void apply_logic_net_one_event(in_t const inp[252], out_t out[1]) {
#pragma HLS INTERFACE m_axi port=inp  offset=slave
#pragma HLS INTERFACE m_axi port=out  offset=slave
#pragma HLS INTERFACE s_axilite port=return bundle=control
#pragma HLS INLINE off

    bool_t out_temp[4096];
    bool_t inp_temp[1512];
    const ap_uint<6> thresholds[6] = {1, 3, 6, 10, 22, 44};
#pragma HLS ARRAY_PARTITION variable=thresholds complete dim=1

    // Convert the inputs into boolean
    for (size_t t = 0; t < 6; t++) {
#pragma HLS unroll
        for (size_t in_idx = 0; in_idx < 252; in_idx++){
#pragma HLS unroll factor=14
            size_t out_idx = t * 252 + in_idx;
            inp_temp[out_idx] = (inp[in_idx] > thresholds[t])? 1 : 0;
        }
    }
    
    //run logic net
    logic_net(inp_temp, out_temp);

    //apply GroupSum
	ap_int<13> sum = 0;
    for (size_t a = 0; a < 4096; a++) {
#pragma HLS UNROLL factor=64
        sum += out_temp[a];
    }

	// Apply tau/beta, clamp to zero
    out_t tmp = 0;  // default to zero
	ap_fixed<16,8> raw = (sum - 1792) / 8.0;  // signed intermediate

	if (raw > 0)
		tmp = (out_t) raw;   // cast to unsigned fixed point

	out[0] = tmp;
}


    
void apply_logic_net(in_t const *inp, out_t *out, size_t len) {
    in_t *inp_temp = (in_t*)malloc(252*sizeof(in_t));
    out_t *out_temp = (out_t*)malloc(1*sizeof(out_t));

    // run inference one event at a time
    for (size_t i = 0; i < len; ++i) {
        for (size_t j = 0; j < 252; ++j) {
            inp_temp[j] = inp[i * 252 + j];
        }
        apply_logic_net_one_event(inp_temp, out_temp);
        for (size_t k = 0; k < 1; ++k) {
            out[i * 1 + k] = out_temp[k];
        }
    }
    free(inp_temp);
    free(out_temp);
}


